import { CreateLinkEvent } from '..';

export function OpenMessengerChat(friendId: number = 0): void
{
    if(friendId === 0) CreateLinkEvent('friends-messenger/open');
    else CreateLinkEvent(`friends-messenger/${ friendId }`);
}
